import './Song.css';

function Song() {
  return (
    <div className='song'>
      <div className='songRank'>
        1. 
      </div>
      <div className='songImage'>
        <img src='https://i.scdn.co/image/ab67616d0000b273c8b444df094279e70d0ed856'></img>
      </div>
      <div className='songDetails'>
        <div className='songTitle'><b>Sugar</b></div>
        <div className='songArtist'>Maroon 5</div>
      </div>
    </div>
  );
}

export default Song;
